function Home(){
    return <div>
                <h1></h1>
                <Contador />
            </div>
}

function Contador(){
    const [contador, setContador] = useState(1);

    function adicionarContador() {
        setContador(contador + 1);

    }

    return (
        <div>
            <div>Contador</div>
            <button onClick={adicionarContador}>Adiociona</button>
        </div>
    )

}

export default Home
